Darth Vader in search of him, but is ambushed by a monstrous, furry wampa. While Han Solo
searches for him, Luke frees himself from the wampa's cave with his lightsaber, but soon
suffers from the sheer-cold temperatures of the snowy wasteland. The spirit of his late
mentor, Obi-Wan Kenobi, appears before him and instructs him to go to the system Dagobah
